import { client } from "./client";

export const getCards = async () => {

    try{
        return  client.getEntries({
            content_type: "productoOpemindTools",
            locale : "es-CO"
        }).then(res => res.items);;

        //return entries;
    } catch(error){
        console.log(error);
    }
};
